import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define a robust selector for the "Electronics" link
    const electronicsSelector = 'a:has-text("Electronics")';

    // Wait for the element to be present and visible
    await page.waitForSelector(electronicsSelector, { state: 'visible', timeout: 5000 });

    // Locate the first "Electronics" link to ensure we click a specific one
    const electronicsLink = page.locator(electronicsSelector).first();

    // Click the link to navigate to the category
    await electronicsLink.click();

    // Take a screenshot after the click
    // Note: In this static HTML example, the page content will not change.
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Extract the text content of the clicked link for verification
    const clickedLinkText = await electronicsLink.textContent();

    return {
      success: true,
      action: "Clicked on the first 'Electronics' category link.",
      extractedData: {
        clickedElementText: clickedLinkText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
